import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Card from './components/Card'


export default function Priority1()
{
  const [array, setarray] = useState([]);
  const [data, setData] = useState(null);
  const [card_list, setcard_list] = useState([]) 
  const fetchData = async () => {
    try {
      const response = await axios.get('https://api.quicksell.co/v1/internal/frontend-assignment');
      setData(response.data.tickets);
    } catch (error) {
      console.error('Axios error:', error);
    }
  };

  const add_card = () => {
    const newArray = [...array];
    const newcardlist=[...card_list];
    for (const item of data) {
        newcardlist.push(<Card name={item.id} desc={item.title}></Card>)
        newArray.push(item);
    }
    setarray(newArray);
    setcard_list(newcardlist);
  };

  useEffect(() => {
    fetchData();
  }, []);

  useEffect(() => {
    if (data) {
      add_card();
    }
  }, [data]);

  console.log('array', array);



    return (
    <div style={{display:"flex",backgroundColor:"rgb(154, 172, 178)",height:"100%"}}>
      
<div style={{width:"20%"}}>No priority <Card name={"CAM-1"} desc={"Add Multi-Language Support - Enable multi-language support within the application."}></Card></div>
<div id='Urgent' style={{width:"20%"}}>Urgent {card_list} </div>
<div id='High' style={{width:"20%"}}>High</div>
<div id='Medium' style={{width:"20%"}}>Medium</div>
<div id='Low' style={{width:"20%"}}>Low</div>


    </div>
  )
}
